BEGIN TRANSACTION;
CREATE TABLE "webapp_voortgang" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "status" varchar(128) NOT NULL);
CREATE TABLE "webapp_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "webapp_user" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"));
CREATE TABLE "webapp_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "webapp_user" ("id"), "group_id" integer NOT NULL REFERENCES "auth_group" ("id"));
CREATE TABLE "webapp_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "voornaam" varchar(128) NOT NULL, "naam" varchar(128) NOT NULL, "email" varchar(128) NOT NULL UNIQUE, "is_active" bool NOT NULL, "is_admin" bool NOT NULL, "straatnaam" varchar(128) NOT NULL, "huisnr" integer NOT NULL, "busnr" varchar(10) NULL, "telefoonnr" integer NOT NULL, "postcode_id" integer NOT NULL REFERENCES "webapp_stad" ("id"), "activation_key" varchar(40) NOT NULL, "key_expires" datetime NOT NULL);
CREATE TABLE "webapp_tagpand" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "value" varchar(255) NOT NULL, "pand_id" integer NOT NULL REFERENCES "webapp_pand" ("id"), "tag_id" integer NOT NULL REFERENCES "webapp_tag" ("id"));
CREATE TABLE "webapp_tag" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tagnaam" varchar(128) NOT NULL);
CREATE TABLE "webapp_stad" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "stadsnaam" varchar(128) NOT NULL, "postcode" varchar(12) NOT NULL);
CREATE TABLE "webapp_partner" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "naam" varchar(128) NOT NULL, "onderschrift" varchar(255) NOT NULL, "foto_url" varchar(255) NOT NULL, "link" varchar(255) NOT NULL);
CREATE TABLE "webapp_pandreview" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "titel" varchar(128) NOT NULL, "auteur" varchar(128) NOT NULL, "text" varchar(500) NOT NULL, "rating" varchar(2) NOT NULL, "created" datetime NOT NULL, "modified" datetime NOT NULL);
CREATE TABLE "webapp_pand" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "straatnaam" varchar(128) NOT NULL, "huisnr" smallint NOT NULL, "handelstatus_id" integer NOT NULL REFERENCES "webapp_handelstatus" ("id"), "postcodeID_id" integer NOT NULL REFERENCES "webapp_stad" ("id"), "user_id" integer NOT NULL REFERENCES "webapp_user" ("id"), "voortgang_id" integer NOT NULL REFERENCES "webapp_voortgang" ("id"), "busnr" varchar(10) NULL, "beschrijving" varchar(1000) NULL, "referentienummer" char(32) NOT NULL UNIQUE, "prijs" decimal NOT NULL, "uitgelicht" bool NOT NULL, "thumbnail_url" varchar(256) NULL);
CREATE TABLE "webapp_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "logText" varchar(255) NOT NULL, "user_id" integer NOT NULL REFERENCES "webapp_user" ("id"));
CREATE TABLE "webapp_handelstatus" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "status" varchar(128) NOT NULL);
CREATE TABLE "webapp_goeddoel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "naam" varchar(128) NOT NULL, "link" varchar(255) NOT NULL, "foto_url" varchar(255) NOT NULL, "bijschrift" varchar(500) NOT NULL);
CREATE TABLE "webapp_foto" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "url" varchar(255) NOT NULL, "docfile" varchar(100) NOT NULL, "pand_id" integer NOT NULL REFERENCES "webapp_pand" ("id"), "thumbnail" bool NOT NULL);
CREATE TABLE "webapp_faq" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "titel" varchar(128) NOT NULL, "content" text NOT NULL);
CREATE TABLE "webapp_ebook" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "naam" varchar(255) NOT NULL, "voornaam" varchar(255) NOT NULL, "email" varchar(255) NOT NULL);
CREATE TABLE "webapp_data" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "titel" varchar(255) NOT NULL, "data" text NOT NULL);
