INSERT INTO `webapp_pand` (id,straatnaam,huisnr,handelstatus_id,postcodeID_id,user_id,voortgang_id,busnr,beschrijving,referentienummer,prijs,uitgelicht,thumbnail_url) VALUES (1,'Nieuwpoortstraat',18,1,1,1,1,'','Eengezinswoning- KLEIN BESCHRIJF MOGELIJK: Ruim en rustig gelegen woning met 3 slaapkamers en een ruime stadstuin De woning is gelegen nabij winkels, scholen en openbaar vervoer in een rustige omgeving bij het centrum van Antwerpen. De woning bevindt zich nabij de hippe wijk Zurenborg, Zwembad/sporthal Borgerhout en op 15 min wandelen van het centraal station van Antwerpen en Berchem Station. Grootste troeven ·De ligging ·Overal dubbele beglazing ·Ruime kamers ·Stadstuin ·Afgelopen 8 jaar werd de woning grondig gerenoveerd. ·Het beschikt over een volledig vernieuwde CV installatie op aardgas.','ce5cebc3bd6b4fa7841258d36afdd805',250000,1,'https://media.giphy.com/media/oIR6xeOffCEBa/giphy.gif');
INSERT INTO `webapp_pand` (id,straatnaam,huisnr,handelstatus_id,postcodeID_id,user_id,voortgang_id,busnr,beschrijving,referentienummer,prijs,uitgelicht,thumbnail_url) VALUES (2,'Zwaluwlaan',21,1,16,1,1,'','GELIJKVLOERS Inkomhal 16m² op keramische Bourgondische tegels met vestiarekast, gastentoilet met handenwasser. Living 75m² op keramische Bourgondische tegels, ingebouwde gashaard met afstandsbediening, plafond met ingebouwde spots en boxen, grote ramen met automatische rolluiken. Via grote boogopening in Franse witte natuursteen naar de leef-eetkeuken 40m² op keramische Bourgondische tegels, boxen, Amerikaanse koelkast Amana, wijnkast, vaatwasser, oven, stoomoven, koffiezetmachine, ingebouwde keramische kookplaat, ingebouwde friteuse, industriële afzuigdamkap, werkbladen in graniet en granieten werkeiland. Alle toestellen type Miele, ingebouwde dubbele spoelbak met Grohne kraan, aparte eethoek.','d85eb1eb9faf42f8be7015cbfa7e8561',375000,1,'http://pictures.immoweb.be/photos/0/6/2/7/7/9/6/4/6277964_1.jpg?cache=20160310191328');
